import React from "react";

export default function Header() {
  return (
    <div className="bg-secondary">
      <div className="flex justify-between items-center max-w-6xl max-auto p-3">

        <h1 className="font-bold"> Auth App</h1>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Sign In</li>
        </ul>
      </div>
    </div>
  );
}
